import {Route , Switch , Link  } from 'react-router-dom';
import Contact from './Contact'
import Menu from './Menu'
import About from './About'

const App=()=>{

return (<>
<Menu/>
<Switch>
    <Route exact path="/" component={About}/>
    <Route path= "/contact" component = {Contact}   />
</Switch>

{/* <About/>
<Contact/> */}


</>);

}

export default App;
